import React from 'react'
import sanjay from '../assets/sanjay.png'
const Card = (image,date,course,fee) => {
  return (
    <div className='w-[30rem] h-[30rem]  border-2 bg-white shadow-full'>
      <img src={sanjay} alt='' className='w-full'/>
    </div>
  )
}

export default Card
